> Texas 6 Republican 2016 hopefuls woo faithful at Texas megachurch Beth Van Duyne, mayor of Irving, Texas, attends the North Texas Presidential Forum hosted by Faith & Freedom Coalition and Prestonwood Baptist Church, Sunday, Oct. 18, 2015, in Plano, Texas. Set to address a presidential forum at the 40,000-member Prestonwood Baptist Church on Sunday are tea party favorites Ted Cruz, Ben Carson, Mike Huckabee and Rick Santorum. (AP Photo/Brandon Wade) 
